import { Card } from '@mui/material'
import React from 'react'

function UserItem({person}) {
  return (
    <Card sx={{ maxWidth: 345 }}>
      <CardHeader title={person.name} subheader={person.loca} />
    </Card>
  );
}

export default UserItem
